import React, {Component} from 'react';

class Home extends Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="Home">
        <h1>LouLou Pei</h1>
        <p>Welcome</p>
      </div>
    );
  }

}

export default Home;
